import React, { Component } from 'react';

import { global } from '../global/Global'
import PhoneDetailComponent from './PhoneDetailComponent';


class PhoneListContainer extends Component {

    url = global.url;

    render() {
        return (
            <React.Fragment>
                <h3 className="my-4">Phone List:</h3>

                <div className="container d-flex phone-container">
                    {this.props.phones.map(phone => (
                        <div key={phone.id}>
                            <div className="card m-3 card-phone">
                                <img src={this.url + phone.picture} className="card-img-top card-image m-2" alt={phone.phone} />
                                <div className="card-body">
                                    <h5 className="card-title">{phone.phone}</h5>

                                    <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>


                                    <p>details: {phone.details}</p>
                                    <p>price: ${phone.price}</p>
                                    <p>year: {phone.year}</p>

                                </div>
                                <ul className="list-group list-group-flush">
                                    <li className="list-group-item">An item</li>
                                    <li className="list-group-item">A second item</li>
                                    <li className="list-group-item">A third item</li>
                                </ul>
                                <div className="card-body">
                                    <a href="#" className="card-link">Card link</a>
                                    <a href="#" className="card-link">Another link</a>
                                </div>
                            </div>


                        </div>

                    ))}


                </div>

                <PhoneDetailComponent></PhoneDetailComponent>




            </React.Fragment>




        )
    }
}

export default PhoneListContainer;
